import React from 'react';
import ActorCard from './actorCard';

const ActorGrid = ({ data }) => {
  return (
    <div>
      {data.map(person => (
        <ActorCard key={person.id} name={person.name} />
      ))}
    </div>
  );
};

export default ActorGrid;
